var wyhImage = {
    image1: "",
    image2: "",
    image3: "",
    image4: "",
    AEStest: function (ciphertext, key) {//AES加密测试
        // 定义待加密的明文和密钥

        // 进行AES加密
        // var ciphertext = CryptoJS.AES.encrypt(plaintext, key).toString();

        // 输出加密结果
        // console.log("密文：" + ciphertext);

        // 进行AES解密
        var bytes = CryptoJS.AES.decrypt(ciphertext, key);
        // 输出解密结果
        return bytes.toString(CryptoJS.enc.Utf8);
    },
    show: function (key) {
        var image1 = $("<img>").attr("src", this.AEStest(this.image1, key)).width('100%');
        var image2 = $("<img>").attr("src", this.AEStest(this.image2, key)).width('100%');
        var image3 = $("<img>").attr("src", this.AEStest(this.image3, key)).width('100%');
        var image4 = $("<img>").attr("src", this.AEStest(this.image4, key)).width('100%');
        $('body').append(image1, image2, image3, image4);
    }
}